import React from 'react'
import '../global_css/commentSection_css/styles.css'


const numsComment = (nums + "Comments")

class CommentSection extends React.Component {
  render() {
    return (
      <div>
      <div>
      <h1>Join the Conversation</h1>
      </div>
      <div className="comment-container"></div>
      <div className="comment-picture">
        <img src="/Assets/Images/Mohan-muruge.jpg"/>
      </div>
      <form className="comment-section">
        NAME<input type="text" id="name" placeholder="Enter Your Name"/>
        COMMENT<textarea id="comment" cols="70" rows="5" placeholder="Add a new comment"></textarea>
        <button>COMMENT</button>
      </form>

      </div>
      // <div className="posted-comments"></div>
    )
  }
}

export default CommentSection
